export const Body = () => {
    const [count, setCount] = useState(0)
    const myCount = useRef(6)
  return (
    <div className='body'>
        <button className='btn' onClick={()=>{
            if(count){
                setCount(count-1)
                myCount=myCount-1
            }
            console.log('count decrement',count)
        }}>-</button>
        <input type="text" value={count}/>
        <button className='btn' onClick={()=>{
            setCount(count+1)
            myCount

        }}>+</button><br/>
        <label> Count : {count} </label> 
    </div>
  )
}
